detaileddescription.para:
This is a simple macro that takes care of declaring debug codes. Use it as follows: TF_DEBUG_CODES(
MY_E1,
MY_E2
);

This is a simple macro that takes care of declaring debug codes, subject to a compile-time condition that enables or disables them completely. Use it as follows: TF_CONDITIONALLY_COMPILE_TIME_ENABLED_DEBUG_CODES(
<EnabledState:acompile-timevalueconvertibletobool>
MY_E1,
MY_E2
);

The TF_DEBUG_TIMED_SCOPE() macro is used as follows: voidAttribute::Compute()
{
TF_DEBUG_TIMED_SCOPE(ATTR_COMPUTE,"Computing%s",name.c_str());
...
}

This call should be used in source files, not header files, and should This macro should usually appear within a TF_REGISTRY_FUNCTION(TfDebug,...) call. The first argument should be the literal name of the enum symbol, while the second argument should be a (short) description of what debugging will be enabled if the symbol is activated. The enum being registered must be one which is contained in some TF_DEBUG_CODES() call. For example: TF_REGISTRY_FUNCTION(TfDebug){
TF_DEBUG_ENVIRONMENT_SYMBOL(MY_E1,"loadingofblah-blahfiles");
TF_DEBUG_ENVIRONMENT_SYMBOL(MY_E2,"parsingofmdlcode");
//etc.
}
